<template>
	<view>
		<view style="background-color: #F1F1F1;height: 60px;font-size: 20px;">当前位置：{{locationText}}</view>
		<view style="background-color: #F1F1F1;height: 60px;font-size: 20px;">wgs84坐标：{{locationPoint}}</view>
		<view :msg="valueChangeSign" :change:msg="myMapViews.valueChange" type="default"></view>
		<template>
			<view style="width: 350px;height: 600px;" id="myMapView" />
		</template>
	</view>
</template>

<!-- 逻辑层代码 -->
<script>
	export default {
		data() {
			return {
				valueChangeSign: "", // 调用视图层方法的信号
				locationInterval: null, // 获取wgs84位置信息的interval
				getPoiNameInterval: null, // 获取火星坐标和poi名称
				locationText: "", // 位置名称（poi）
				locationPoint: "", // 位置wgs84坐标
			}
		},
		methods: {
			/**
			 *  给renderJS调用的方法
			 */
			methodForRenderJs: function(val) {
				console.log("我是逻辑层，被视图层调用了，并且收到参数：");
				console.log(val);
			},

			/**
			 *  uniapp 获取wgs84坐标
			 */
			getWgs84LocationInterval() {
				let this_ = this;
				this.locationInterval = null;
				this.locationInterval = setInterval(function() {
					uni.getLocation({
						type: 'wgs84',
						geocode: true,
						success: function(res) {
							// 获取到经纬度
							var lon = res.longitude;
							var lat = res.latitude;
							this_.locationPoint = lon + "," + lat;
							this_.valueChangeSign = [new Date().getTime(), [lon, lat]];
						},
						fail(e) {
							if (e.errMsg.includes("geolocation:14")) {
								console.log("gps定位信号弱 ")
							} else if (e.errMsg.includes("geolocation:12")) {
								console.log("无法定位!请开启gps定位权限。")
							}
						}
					});
				}, 3 * 1000);
			},

			/**
			 *  uniapp 获取火星坐标以及位置信息
			 */
			getPoiNameInterVal: function() {
				let this_ = this;
				this.getPoiNameInterval = null;
				this.getPoiNameInterval = setInterval(function() {
					uni.getLocation({
						type: 'gcj02',
						geocode: true,
						success: function(res) {
							if (res && res.address) {
								res.address.street = res.address.street ? res.address.street :
									"";
								res.address.poiName = res.address.poiName ? res.address
									.poiName : "";
								this_.locationText = res.address.poiName;
							}
						},
					});
				}, 3 * 1000);
			}
		},
		onShow() {
			let this_ = this;
			// 设置获取wgs84位置信息的定时器
			this.getWgs84LocationInterval();
			// 设置获取火星坐标和poi名称的定时器
			this.getPoiNameInterVal();
		}
	}
</script>

<!-- RenderJS视图层代码 -->
<script module="myMapViews" lang="renderjs">
	import {
		loadModules
	} from 'esri-loader'
	export default {
		name: 'myMapView',
		data() {
			return {
				myMapObject: {}, // 对象，存储关于地图的图层、方法、属性等
				pictureMarkerUrl: "data:image/png;base64,",
			}
		},
		methods: {
			createMapView() {
				var this_ = this;
				return new Promise(function(resolve) {
					const options = {
						url: 'https://js.arcgis.com/4.14/init.js',
						css: 'https://js.arcgis.com/4.14/esri/themes/light/main.css'
					};
					loadModules([
						"esri/Map",
						"esri/views/MapView",
						"esri/Basemap",
						"esri/layers/Layer",
						"esri/layers/TileLayer",
						"esri/layers/GraphicsLayer",
						"esri/geometry/Point",
						"esri/Graphic",
						"esri/geometry/SpatialReference",
						"esri/geometry/support/webMercatorUtils"
					], options).then(([Map, MapView, Basemap, Layer, TileLayer, GraphicsLayer, Point, Graphic,
						SpatialReference, webMercatorUtils
					]) => {

						// 地图的底图 这里使用的是arcgisonline
						var url =
							"http://cache1.arcgisonline.cn/arcgis/rest/services/ChinaOnlineCommunity_Mobile/MapServer";
						var basemaplayer = new TileLayer({
							url: url,
							visible: true,
						});

						// 地图对象
						var map = new Map({
							basemap: "", // 底图置空
							layers: [basemaplayer], // 添加自定义的layer为底图
						});

						// 创建一个mapView并绑定页面元素
						var view = new MapView({
							container: "myMapView",
							map: map,
							zoom: 1, // 缩放比例 值越大图越大
						});

						// 地图加载完成事件
						view.when(function() {
							console.log("地图加载完成了！");
							resolve();
						});

						// 定义myMapObject的方法供外部调用
						this_.myMapObject.methodForOutSide = function(val) {
							console.log("methodForOutSide方法被调用了：" + val);
						}

						// 创建实时定位的图形图层
						var graphicsLayer = new GraphicsLayer();
						// 创建点击的图形图层
						var clickLayer = new GraphicsLayer();

						map.graphicsLayer = graphicsLayer;
						map.clickLayer = clickLayer;
						// 把这个图层添加到地图中 添加的先后顺序就是图层的底层-向上的顺序
						map.add(map.graphicsLayer);
						map.add(map.clickLayer);

						// 对传入的坐标lon,lat进行定位
						this_.myMapObject.goLocate = function(lon, lat) {
							// 这里接收到的是84坐标 
							// 创建84坐标系
							var sr84 = new SpatialReference({
								wkid: 4326
							});
							// 不传坐标系也可以,默认84坐标系
							var point84 = new Point(lon, lat, sr84);

							// 创建一个piture-marker symbol符号
							// url是一张图的地址，建议使用绝对url或者base64 不要写相对路径
							var symbol = {
								type: "picture-marker",
								url: this_.pictureMarkerUrl,
								width: "30px",
								height: "30px"
							};

							// 创建一个graphic 传入点和symbol
							var graphic = new Graphic({
								geometry: point84,
								symbol: symbol
							})

							// 先清空图层上的元素
							map.graphicsLayer.removeAll();
							// 将当前位置添加到图层
							map.graphicsLayer.add(graphic);
						}

						this_.myMapObject.map = map;

						// 地图点击事件
						view.on("click", function(event) {

							// mapPoint的longitude和latitude是84坐标的经纬度
							// x,y是地图坐标系的经纬度，这里是webMercator坐标系
							console.log(event.mapPoint);

							// 创建84坐标系
							var sr84 = new SpatialReference({
								wkid: 4326
							});
							// 转换成84坐标系点
							console.log(webMercatorUtils);
							var point84 = webMercatorUtils.webMercatorToGeographic(event.mapPoint);

							// 创建webMercator坐标系
							var srWm = new SpatialReference({
								wkid: 102100
							});
							// 获取webMercator坐标系的点
							var pointWm = event.mapPoint;

							var circleymbol = {
								type: "simple-marker",
								style: "circle",
								color: [255, 102, 102, 1],
								size: "15px",
								outline: {
									color: [102, 253, 204, 0.8],
									width: 1
								}
							};
							// 创建一个graphic 传入坐标点
							var graphic = new Graphic({
								geometry: point84,
								symbol: circleymbol
							})
							// 添加到点击图层
							this_.myMapObject.map.clickLayer.add(graphic);
						})
					})
				})
			},

			valueChange(newVal, oldVal, ownerVm, vm) {
				var location = newVal[1];
				console.log("获取到wgs84Location...");
				console.log(location);
				this.myMapObject.goLocate(location[0], location[1]);
			},

		},
		mounted() {
			// 页面初始化完成后
			var this_ = this;
			this.createMapView().then(function() {
				console.log("加载地图的promise执行结束了....")
				// 打印地图对象
				console.log(this_.myMapObject.map);
				// 调用createMapView()内部的方法
				this_.myMapObject.methodForOutSide();
				// renderJs主动调用逻辑层的方法
				this_.$ownerInstance.callMethod('methodForRenderJs', {
					val1: "参数1",
					val2: "参数2"
				});
			});
		},
	}
</script>

<style>
	/deep/.esri-widget--button {
		display: none;
	}

	/deep/.esri-attribution__powered-by {
		display: none;
	}

	/deep/.esri-view .esri-view-surface--inset-outline:focus::after {
		outline: none;
	}
</style>
